import React from 'react'
import {AppBar, Toolbar, styled} from '@mui/material'



const Navbar = () => {
  return (
    <AppBar position="static">
        <Toolbar>
            <p>AllUsers</p>
            <p>AddcUser</p>
            <p>Edit Users</p>
        </Toolbar>
    </AppBar>
  )
}

export default Navbar;
